id:
Optionally provide service-specific configuration parameters in a valid JSON object in-line.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Optionally provide a file containing service-specific configuration parameters in a valid JSON object. 
The path to the parameters file can be an absolute or relative path to a file.
CF_NAME update-service -c PATH_TO_FILE

Example of valid JSON object:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

translation:
Optional stellen Sie servicespezifische Konfigurationsparameter in einem gültigen JSON-Objekt integriert zur Verfügung.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Optional stellen Sie eine Datei mit servicespezifischen Konfigurationsparametern in einem gültigen JSON-Objekt zur Verfügung. 
Der Pfad zur Parameterdatei kann ein absoluter oder relativer Pfad zu einer Datei sein.
CF_NAME update-service -c PATH_TO_FILE

Beispiel für ein gültiges JSON-Objekt:
{
    "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

